U32 precis_xprop_lookup(U32 cp)
{
    if ((cp & 0x00FFFE) == 0x00FFFE || 0x040000 <= cp)
	return 0;

    switch (cp) {
    case 0x006C:		/* LATIN SMALL LETTER L */
    case 0x0375:		/* GREEK LOWER NUMERAL SIGN */
    case 0x200C:		/* ZERO WIDTH NON-JOINER */
    case 0x200D:		/* ZERO WIDTH JOINER */
    case 0x00B7:		/* MIDDLE DOT */
    case 0x05F3:		/* HEBREW PUNCTUATION GERESH */
    case 0x05F4:		/* HEBREW PUNCTUATION GERSHAYIM */
    case 0x30FB:		/* KATAKANA MIDDLE DOT */
	return cp;
    }
    if (0x0660 <= cp && cp <= 0x0669)
	return BK_Arabic_Indic_digits;
    if (0x06F0 <= cp && cp <= 0x06F9)
	return BK_extended_Arabic_Indic_digits;

    return precis_xprop_array[precis_xprop_index[cp >> XPROP_BLKWIDTH] +
			      (cp & ((1 << XPROP_BLKWIDTH) - 1))
	];
}

