STRLEN precis_prepare(U8 * buf, const STRLEN buflen, int stringclass,
		      U8 unicode_version, U8 ** errptr, STRLEN * errlenptr,
		      STRLEN * idxptr, U32 * cpptr)
{
    U8 *p = buf;
    const U8 *end = buf + buflen;
    const U8 *end4 = end - 4;

    STRLEN seqlen = 0, idx = 0, ctxidx = 0, kmdidx = 0, ctxlen = 0;
    U32 cp = 0, ctxcp = 0;
    U8 prop = PRECIS_PVALID;
    state_t state = ST_INIT;
    U8 *kmd = NULL, *ctx = NULL;
    U8 has_hankana = 0, has_aid = 0, has_eaid = 0;

    U32 vec;
    U32 xprop;

    while (p < end4) {
      check:
	/* Check if string consists of valid UTF-8 sequences. */
	seqlen = utf8_sequence_len[*p];

	switch (seqlen) {
	case 0:
	    goto illseq;

	case 1:
	    /* 0xxxxxxx */
	    cp = (U32) p[0];
	    break;

	case 2:
	    /* 110xxxxx 10xxxxxx */
	    if ((p[1] & 0xC0) != 0x80)
		goto illseq;
	    cp = ((U32) (p[0] & 0x1F) << 6) | ((U32) (p[1] & 0x3F));
	    break;

	case 3:
	    vec = ((U32) p[0] << 16) | ((U32) p[1] << 8) | ((U32) p[2]);
	    /* 1110xxxx 10xxxxxx 10xxxxxx *//* Shortest form */
	    if ((vec & 0x00F0C0C0) != 0x00E08080 || vec < 0x00E0A080)
		goto illseq;
	    cp = ((U32) (p[0] & 0x0F) << 12)
		| ((U32) (p[1] & 0x3F) << 6) | ((U32) (p[2] & 0x3F));
	    /* Surrogates U+D800..U+DFFF */
	    if ((cp & 0x00D800) == 0x00D800)
		goto disallowed;
	    /* Non-characters U+FDD0..U+FDEF, U+FFFE..U+FFFF */
	    if (0x00FDD0 <= cp && cp <= 0x00FDEF)
		goto disallowed;
	    if ((cp & 0x00FFFE) == 0x00FFFE)
		goto disallowed;
	    break;

	case 4:
	    vec = ((U32) p[0] << 24)
		| ((U32) p[1] << 16) | ((U32) p[2] << 8) | ((U32) p[3]);
	    /* 11110xxx 10xxxxxx 10xxxxxx 10xxxxxx *//* Shortest form */
	    if ((vec & 0xF8C0C0C0) != 0xF0808080 || vec < 0xF0908080)
		goto illseq;
	    cp = ((U32) (p[0] & 0x07) << 18)
		| ((U32) (p[1] & 0x3F) << 12)
		| ((U32) (p[2] & 0x3F) << 6) | ((U32) (p[3] & 0x3F));
	    /* Greater than U+10FFFF */
	    if (0x10FFFF < cp)
		goto disallowed;
	    /* Non-characters U+nFFFE..U+nFFFF */
	    if ((cp & 0x00FFFE) == 0x00FFFE)
		goto disallowed;
	    break;

	  illseq:
	    seqlen = 0;
	    cp = 0;
	    /* goto disallowed; */
	  disallowed:
	    prop = PRECIS_DISALLOWED;
	    goto done;
	}			/* switch (seqlen) */

	/* Check if character is assigned by specified version of Unicode. */
	if (unicode_version != 0
	    && unicode_version < precis_age_lookup(cp)) {
	    prop = PRECIS_UNASSIGNED;
	    goto done;
	}

	switch (stringclass) {
	case PRECIS_FREE_FORM_CLASS:
	case PRECIS_IDENTIFIER_CLASS:
	    /* Resolve property. */
	    prop = precis_prop_lookup(cp);

	    switch (prop) {
	    case PRECIS_PVALID:
	    case PRECIS_CONTEXTJ:
	    case PRECIS_CONTEXTO:
		break;

	    case PRECIS_ID_DIS:
		if (stringclass == PRECIS_IDENTIFIER_CLASS) {
		    prop = PRECIS_DISALLOWED;
		    goto done;
		} else
		    prop = PRECIS_PVALID;
		break;

	    default:
		goto done;
	    }

	    xprop = precis_xprop_lookup(cp);

	    switch (state) {
	    case ST_ZWNJ:
		/* Rule 1.2 bottom half */
		switch (xprop) {
		case JT_T:
		    prop = PRECIS_CONTEXTJ;
		    break;
		case JT_R:
		case JT_D:
		    state = ST_INIT;
		    break;
		default:
		    p = ctx;
		    seqlen = ctxlen;
		    idx = ctxidx;
		    cp = ctxcp;
		    prop = PRECIS_CONTEXTJ;
		    goto done;
		}
		break;

	    case ST_MIDDLEDOT:
		/* Rule 3 bottom half */
		switch (xprop) {
		case 0x006C:	/* LATIN SMALL LETTER L */
		    state = ST_SMALLL;
		    break;
		default:
		    p = ctx;
		    seqlen = ctxlen;
		    idx = ctxidx;
		    cp = ctxcp;
		    prop = PRECIS_CONTEXTO;
		    goto done;
		}
		break;

	    case ST_KERAIA:
		/* Rule 4 bottom half */
		switch (xprop) {
		case 0x0375:	/* GREEK LOWER NUMERAL SIGN (KERAIA) */
		    break;
		case SC_Greek:	/* Greek except KERAIA */
		    state = ST_INIT;
		    break;
		default:
		    p = ctx;
		    seqlen = ctxlen;
		    idx = ctxidx;
		    cp = ctxcp;
		    prop = PRECIS_CONTEXTO;
		    goto done;
		}
		break;

	    default:
		switch (xprop) {

		case CCC_VIRAMA:
		    /* See rules 1 and 2. */
		    state = ST_VIRAMA;
		    break;

		case SC_Hebrew:	/* Hebrew except GERESH and GERSHAYIM */
		    /* See rules 5 and 6. */
		    state = ST_HEBREW;
		    break;

		    /* Rule 1: ZERO WIDTH NON-JOINER */
		case JT_L:
		case JT_D:
		    state = ST_L_OR_D;
		    break;

		case JT_T:
		    switch (state) {
		    case ST_L_OR_D:
			break;
		    default:
			state = ST_INIT;
		    }
		    break;

		case 0x200C:	/* ZWNJ, CONTEXTJ */
		    switch (state) {
		    case ST_VIRAMA:
			prop = PRECIS_PVALID;
			state = ST_INIT;
			break;
		    case ST_L_OR_D:
			ctx = p;
			ctxlen = seqlen;
			ctxidx = idx;
			ctxcp = cp;
			state = ST_ZWNJ;
			break;
		    default:
			goto done;
		    }
		    break;

		    /* Rule 2: ZERO WIDTH JOINER */
		case 0x200D:	/* ZWJ, CONTEXTJ */
		    switch (state) {
		    case ST_VIRAMA:
			prop = PRECIS_PVALID;
			state = ST_INIT;
			break;
		    default:
			goto done;
		    }
		    break;

		    /* Rule 3: MIDDLE DOT */
		case 0x006C:	/* LATIN SMALL LETTER L */
		    state = ST_SMALLL;
		    break;

		case 0x00B7:	/* MIDDLE DOT, CONTEXTO */
		    switch (state) {
		    case ST_SMALLL:
			ctx = p;
			ctxlen = seqlen;
			ctxidx = idx;
			ctxcp = cp;
			state = ST_MIDDLEDOT;
			break;
		    default:
			goto done;
		    }
		    break;

		    /* Rule 4: GREEK LOWER NUMERAL SIGN */
		case 0x0375:	/* GREEK LOWER NUMERAL SIGN (KERAIA) */
		    ctx = p;
		    ctxlen = seqlen;
		    ctxidx = idx;
		    ctxcp = cp;
		    state = ST_KERAIA;
		    break;

		    /* Rule 5: HEBREW PUNCTUATION GERESH */
		case 0x05F3:	/* GERESH, CONTEXTO */
		    switch (state) {
		    case ST_HEBREW:
			prop = PRECIS_PVALID;
			break;
		    default:
			goto done;
		    }
		    break;

		    /* Rule 6: HEBREW PUNCTUATION GERSHAYIM */
		case 0x05F4:	/* GERSHAYIM, CONTEXTO */
		    switch (state) {
		    case ST_HEBREW:
			prop = PRECIS_PVALID;
			break;
		    default:
			goto done;
		    }
		    break;

		default:
		    state = ST_INIT;

		    switch (xprop) {

			/* Rule 7: KATAKANA MIDDLE DOT */
		    case SC_Han:
		    case SC_Hiragana:
		    case SC_Katakana:
			has_hankana = 1;
			break;

		    case 0x30FB:	/* KATAKANA MIDDLE DOT */
			if (kmd == NULL) {
			    kmd = p;
			    kmdidx = idx;
			}
			prop = PRECIS_PVALID;
			break;

			/* Rule 8: ARABIC-INDIC DIGITS */
		    case BK_Arabic_Indic_digits:
			/* Arabic-Indic digits, CONTEXTO */
			if (has_eaid)
			    goto done;
			else {
			    prop = PRECIS_PVALID;
			    has_aid = 1;
			}
			break;

			/* Rule 9: EXTENDED ARABIC-INDIC DIGITS */
		    case BK_extended_Arabic_Indic_digits:
			/* Extended Arabic-Indic digits, CONTEXTO */
			if (has_aid)
			    goto done;
			else {
			    prop = PRECIS_PVALID;
			    has_eaid = 1;
			}
			break;

		    default:
			assert(prop == PRECIS_PVALID);
			assert(xprop == 0);
		    }		/* switch (xprop) */
		}		/* switch (xprop) */
	    }			/* switch (state) */

	    break;

	default:
	    break;
	}			/* switch (stringclass) */

	p += seqlen;
	idx++;
    }				/* while (p < end4) */
    if (p < end && p + utf8_sequence_len[*p] <= end)
	goto check;

  done:
    if (kmd != NULL && !has_hankana) {
	if (errptr != NULL)
	    *errptr = kmd;
	if (errlenptr != NULL)
	    *errlenptr = 3;
	if (idxptr != NULL)
	    *idxptr = kmdidx;
	if (cpptr != NULL)
	    *cpptr = 0x0030FB;
	prop = PRECIS_CONTEXTO;
    } else if (prop == PRECIS_DISALLOWED || prop == PRECIS_UNASSIGNED
	       || prop == PRECIS_CONTEXTJ || prop == PRECIS_CONTEXTO) {
	if (errptr != NULL)
	    *errptr = p;
	if (errlenptr != NULL)
	    *errlenptr = seqlen;
	if (idxptr != NULL)
	    *idxptr = idx;
	if (cpptr != NULL)
	    *cpptr = cp;
    }

    return prop;
}
